	add("voicism", "{\"term\":\"voicism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|voice|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Discrimination against and negative perception of people based on how their voices sound\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, w:Pam Pam Ayres, \u0026quot;[http://www.independent.co.uk/opinion/permit-me-my-wrinkles-1577343.html Permit me my wrinkles]\u0026quot;, \u0027The Independent\u0027, 13 October 1995\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Yet I hardly ever see a reference to myself in the press without some put-down relating to my voice. Make way for the Bucolic Bard, the Rustic Rhymster, the Shakespeare of the Shires. It is irritating after 20 years. But, Mrs Shephard, despite all my years of fighting \u0026quot;\u0027\u0027voicism\u0027\u0027\u0026quot;, I would not want all the wrinkles ironed out of our language\", \"priority\":3}]}, \"synonyms\":{}}");

	add("voidee", "{\"term\":\"voidee\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"anglo-norman\"], \"text\":\"From Anglo-norman lt;!--, a past participle of \u0027voider\u0027 () apparently referring to the departure from the hall of those not sleeping there--\u0026gt;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cup of wine drunk with spices or other small accompaniments, taken before retiring to bed or before the departure of guests; also, a larger snack or small meal taken in similar circumstances\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"c. 1385\u0027\u0027, Geoffrey Chaucer, \u0027Troilus and Criseyde\u0027, Book III\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Ther nys no more, but here-after soone, / The \u0027\u0027voide\u0027\u0027 dronke, and trauers drawe anon, / Gan euery wight that hadde nought to done / More in the place out of the chaumbre gon\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1400\u0027\u0027, JN. Shirley, Dethe of James Stewarde, Kyng of Scotys, page 13, ed. 1818\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Within an owre the Kyng askid the \u0027\u0027voidee\u0027\u0027, and drank, the travers yn the chambure edraw, and every man depairtid and went to rist\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"notes to w:Ann Ann Ward Radcliffe’s \u0027w:Gaston de Gaston de Blondeville\u0027, in \u0027The Posthumous Works of Mrs. Radcliffe\u0027, Volume III, Henry Colburn (publisher, 1826), [http://books.google.com/books?id\u003dOTA3AAAAIAAJ\u0026amp;pg\u003dPA83\u0026amp;dq\u003dvoidee page 83\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Before the \u0027\u0027voidee\u0027\u0027, came in five score couple, Earles, Barons, and Knights, over and besides Squiers, having collers and chains of gould, every each of them throughout, bearing the one of them a spice-plate, the other a cuppe, beside yeomen of the guard that followed them with potts of wine to fill the cuppes. The spice-plates were furnished in the most goodly manner with spices, after the manner of a \u0027\u0027voidee\u0027\u0027; and the cuppes were replenished with wine, and universally throughout the said hall distributed\", \"priority\":7}]}, \"synonyms\":{}}");

	add("voider", "{\"term\":\"voider\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who, or that which, voids, empties, vacates, or annuls\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A tray or basket formerly used to receive or convey that which is voided or cleared away from a given place; especially, one for carrying off the remains of a meal, as fragments of food; sometimes, a basket for containing household articles, as clothes, etc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Decke\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Piers Plowman laid the cloth, and Simplicity brought in the \u0027\u0027voider\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"History of Richard Hainam\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The cloth whereon the earl dined was taken away, and the \u0027\u0027voider\u0027\u0027, wherein the plate was usually put, was set upon the cupboard\u0027s head\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A servant whose business is to void, or clear away, a table after a meal\", \"priority\":7}]}, \"synonyms\":{}}");

